function hashPassword(e){e.preventDefault();var e=document.getElementById("password").value,t=document.getElementById("service").value.toLowerCase(),s=document.getElementById("info").value.toLowerCase();res=b85encode(fromHexString(sha3_256(concat3(byteHashOfStr(e),byteHashOfStr(t),byteHashOfStr(s))))),document.getElementById("result").value=res,document.getElementById("result").style.display=""}